INSERT INTO `onl_cgform_enhance_js` (`ID`, `CG_JS`, `CG_JS_TYPE`, `CONTENT`, `CGFORM_HEAD_ID`) VALUES ('6dd82d8eac166627302230a809233481', 'ces_order_goods_onlChange(){\n    return {\n        num(){\n           \n            let id = event.row.id\n            let num = event.row.num\n            let price = event.row.price\n\n            let targrt = event.target\n            \n            let nval = price*num\n            console.log(\'row\',event.row);\n            console.log(\'num\',num);\n            console.log(\'that\',that);\n            let otherValues = {\'zong_price\': nval}\n              \n            that.triggleChangeValues(otherValues,id,targrt)\n   \n\n        }\n    }\n}', 'form', NULL, '56efb74326e74064b60933f6f8af30ea');
INSERT INTO `onl_cgform_enhance_js` (`ID`, `CG_JS`, `CG_JS_TYPE`, `CONTENT`, `CGFORM_HEAD_ID`) VALUES ('73ff4666e0cf5c2070263345e1e11835', 'one(){\n  console.log(\'当前选中行的id\', this.selectedRowKeys);\n}\n\nbeforeDelete(row){\n  return new Promise(resolve=>{\n    console.log(\'删除数据之前看看数据\', row);\n    resolve();\n  });\n}', 'list', NULL, '553a4172fde446419cb602dc70f9ee67');
INSERT INTO `onl_cgform_enhance_js` (`ID`, `CG_JS`, `CG_JS_TYPE`, `CONTENT`, `CGFORM_HEAD_ID`) VALUES ('7eb729767ea8f977db918bba455018f9', 'openBrowser(row){\n  //console.log(\"current row\", row)\n  try{\n    getAction(\'http://localhost:3500/api/check\').then(res=>{\n    postAction(\'http://localhost:3500/api/browser/open?key=\'+row.name, row).then(res=>{\n    console.log(res)\n  })\n  }).catch(err=>{\n    //console.warn(err)\n    alert(\'You must open browser in W3RPA client\')\n  })\n  }catch(err){\n    console.log(err)\n  }\n}', 'list', NULL, '40289f94844604be0184479875490002');
