INSERT INTO `rpa_flow_script` (`id`, `name`, `description`, `type`, `templateid`, `script`, `gitpath`, `create_by`, `create_time`, `update_by`, `update_time`, `sys_org_code`, `support_headless`) VALUES ('1594886537573613570', 'baidu-init', 'demo baidu初始化（人工执行）', 'playwright-js', '', '', '', 'louise', '2022-11-22', 'louise', '2022-11-22', 'A03', '0');
INSERT INTO `rpa_flow_script` (`id`, `name`, `description`, `type`, `templateid`, `script`, `gitpath`, `create_by`, `create_time`, `update_by`, `update_time`, `sys_org_code`, `support_headless`) VALUES ('1594890904708104194', 'baidu-visit', 'demo 访问百度和指纹检查页面', 'playwright-js', '', 'const log = require(\'electron-log\')\nconst browserUtil = require(\'../../dist/rpa/browserUtil\')\nconst dataUtil = require(\'../../dist/rpa/dataUtil\')\nconst {flowAction, flowSetup, flowClose} = require(\'../../dist/rpa/rpaUtil\')\n\nconst flow_start2 = async ({item, rpaConfig}) => {\n    // first step\n    await flowSetup({item, rpaConfig})\n\n    // more actions\n    await flowAction(\'your name\', async({item, page, context})=>{\n        let indexUrl = \'https://www.baidu.com/\'\n        //console.debug(indexUrl)\n        await page.goto(indexUrl)\n        //await page.screenshot({path:path.join(rpaConfig.appDataPath, \'logs/1.png\')})\n        // 回写数据到项目明细\n        item[\'update_time\'] = dataUtil.getDateTime()\n        log.debug(\'will update item:\'+ JSON.stringify(item))\n        if(\'id\' in item){\n            await dataUtil.updateDetailData(\'w3_project_account\', item)\n        }\n    })\n\n    // last step\n    await flowClose()\n}\n\nconst flow_start = async ({item, rpaConfig}) => {\n        log.debug(\"invoke flow_start\")\n        //log.debug(item)\n        dataUtil.dataUtilInit(rpaConfig)\n        // // 浏览器参数初始化\n        // browser.browserInit(rpaConfig)\n        // let browserConfig = await browser.getBrowserConfig(item[\'browser\'])\n        // // 启动浏览器\n        // let context = await browser.launchBrowserContext(browserConfig)\n        let context = await browserUtil.launchBrowserContext2({item,rpaConfig})\n        // const page = await context.newPage();\n        const page = await browserUtil.newPage(context);\n        let indexUrl = \'https://www.baidu.com/\'\n        //console.debug(indexUrl)\n        await page.goto(indexUrl)\n        let rpaAdmin = \'https://rpa.w3bb.cc\'\n        await page.goto(rpaAdmin)\n        //await page.screenshot({path:path.join(rpaConfig.appDataPath, \'logs/1.png\')})\n        // 回写数据到项目明细\n        item[\'update_time\'] = dataUtil.getDateTime()\n        //log.debug(\'will update item:\'+ JSON.stringify(item))\n        if(\'id\' in item){\n            await dataUtil.updateDetailData(\'w3_project_account\', item)\n        }     \n        await browserUtil.closeBrowserContext(context, item)\n        log.debug(\'task flow complete\')\n        return 0\n}\n\nexports = module.exports = {\n    flow_start: flow_start\n}', '', 'louise', '2022-11-22', 'admin', '2022-12-19', 'A03', '1');
INSERT INTO `rpa_flow_script` (`id`, `name`, `description`, `type`, `templateid`, `script`, `gitpath`, `create_by`, `create_time`, `update_by`, `update_time`, `sys_org_code`, `support_headless`) VALUES ('1598370081000177666', 'cmc_collect', '领取砖石', 'playwright-js', '', 'const browserUtil = require(\'../../dev/rpa/browserUtil\')\nconst dataUtil = require(\'../../dev/rpa/dataUtil\')\n\nconst axios = require(\'axios\').default;\nconst fs = require(\'fs\')\nconst path = require(\'path\')\n\nconst log = require(\'electron-log\').create(\'cmc_collect\')\nObject.assign(console, log.functions)\nlog.transports.file.resolvePath = () => path.join(__dirname, \'logs\', \'cmc_collect.log\')\n\n\nconst scriptConfig = {\n    \"randommin\": 40,\n    \"randommax\": 60,\n    \"remoteImgCheckUrl\": \"http://47.102.124.108:5678/checkJiuGongGeImg\",\n    \"checkSliderUrl\": \"http://47.102.124.108:5678/checkSlider\",\n    \"getDataByEmail\": \"http://81.68.141.58:5678/getDataByEmail\"\n}\n\nconst tableKey = \'air_coinmarketcap\';\n\nconst flow_start = async ({item, rpaConfig}) => {\n    log.debug(\"invoke flow_start\")\n    log.debug(item)\n    // let browserConfig = await getBrowserConfig(item[\'browser\'])\n    // let context = await launchBrowserContext(browserConfig)\n    dataUtil.dataUtilInit(rpaConfig);\n\n    let queryParams = {}\n    queryParams[\'pageSize\'] = 1\n    Object.assign(queryParams, {\'username\': item[\'username\']})\n    Object.assign(queryParams, {\'reg_status\': 2})\n\n    console.log(\"queryParams\", queryParams)\n\n\n    let coinmarketcap\n    let result = await dataUtil.getListData(tableKey, queryParams)\n    console.log(result)\n    if (!!result && result.records.length > 0) {\n        coinmarketcap = result.records[0]\n    }\n    if (!!coinmarketcap) {\n\n        console.info(\"lastsuc_date:\", coinmarketcap.lastsuc_date);\n        if (coinmarketcap.lastsuc_date) {\n            const nowtime = new Date(new Date().valueOf() + new Date().getTimezoneOffset() * 60 * 1000);\n            const lasttime = new Date(new Date(coinmarketcap.lastsuc_date).valueOf() + new Date(coinmarketcap.lastsuc_date).getTimezoneOffset() * 60 * 1000);\n            if (new Date(dateFormat(lasttime, \'YYYY-MM-DD HH:mm:ss\')).getTime() > new Date(dateFormat(nowtime, \'YYYY-MM-DD\')).getTime()) {\n                console.info(\"账号\" + coinmarketcap.username + \"今天已经领取过了：\" + dateFormat(lasttime, \'YYYY-MM-DD HH:mm:ss\'));\n                return;\n            }\n        }\n\n        const password = await dataUtil.loadProjectUserPassword(item);\n        console.log(\"password:\", password);\n        let context = await browserUtil.launchBrowserContext2({browserInfo: item[\'browser\'], rpaConfigJson: rpaConfig})\n\n\n        let page = null;\n        try {\n            await sleep(3000);\n            let pages = context.pages();\n            while (pages.length > 1) {\n                pages[0].close();\n                pages = context.pages();\n                await sleep(1000);\n            }\n\n            page = pages[0];\n            page.waitForTimeout(1000);\n\n            const ua = await page.evaluate(\"navigator.userAgent;\");\n            console.log(\"ua:\" + ua);\n\n            await page.goto(\"https://coinmarketcap.com/account/my-diamonds/\", {waitUntil: \"domcontentloaded\"});\n            await page.waitForTimeout(3000);\n\n            if (await page.locator(\'//button[text()=\"Check it now\"]\').isVisible()) {\n                await page.locator(\'.modalOpened .close-button\').click();\n                await page.waitForTimeout(1000);\n            }\n\n            console.log(\"判断是否登录过\");\n            if (await page.isVisible(\'.notificationIcon\')) {\n                console.log(\"已经登陆了,去领取\");\n                coinmarketcap = await collect(page, coinmarketcap);\n            } else {\n                console.log(\"去登陆\");\n                if (await login(page, coinmarketcap, password)) {\n                    coinmarketcap = await collect(page, coinmarketcap);\n                }\n            }\n\n        } catch (e) {\n            console.error(e);\n        } finally {\n            if (page != null) {\n                await page.close();//关闭网页\n            }\n            await dataUtil.updateDetailData(tableKey, coinmarketcap);\n            // await browserUtil.closeBrowserContext(context)\n            await context.close();\n        }\n\n    }\n\n    const sleepNum = randomNum(scriptConfig.randommin, scriptConfig.randommax);\n    console.log(\"随机休眠\" + sleepNum + \"秒\");\n    await sleep(sleepNum * 1000);\n\n}\n\nexports = module.exports = {\n    flow_start: flow_start\n}\n\n/**\n * 领取\n * @param {Object} [coinmarketcap]\n * @param {import(\"playwright-core\").Page} page\n */\nasync function collect(page, coinmarketcap) {\n    await page.waitForTimeout(3000);\n    if (await page.locator(\'//button[text()=\"Collect Diamonds\"]\').isVisible()) {\n        console.log(\"可以领取砖石\");\n        let retryNum = 0;\n        while (retryNum < 10) {\n            retryNum++;\n            if (await page.locator(\'//button[text()=\"Collect Diamonds\"]\').isVisible()) {\n                await page.locator(\'//button[text()=\"Collect Diamonds\"]\').click();\n                if (await downloadAndCheckImg(page)) {\n                    await page.waitForTimeout(3000);\n                    if (await page.locator(\'//button[text()=\"OK\"]\').isVisible()) {\n                        console.log(\"领取成功\");\n                        await page.waitForTimeout(2000);\n                        coinmarketcap = await getBlanaceAndUpdate(page, coinmarketcap);\n                        break;\n                    } else if ((await page.locator(\'//button[@data-btnname=\"Log In to Collect\"]\').textContent()).indexOf(\'to collect\') > -1) {\n                        coinmarketcap = await getBlanaceAndUpdate(page, coinmarketcap);\n                    } else {\n                        log.info(\"未知状态\");\n                    }\n                }\n            }\n        }\n    } else {\n        console.log(\"今天已经领取过了\");\n        if (await page.locator(\'//button[@data-btnname=\"Log In to Collect\"]\').isVisible()) {\n            let nextTime = await page.locator(\'//button[@data-btnname=\"Log In to Collect\"]\').textContent();\n            if (nextTime == \'Log In to Collect\') {\n                await page.waitForTimeout(2000);\n                nextTime = await page.locator(\'//button[@data-btnname=\"Log In to Collect\"]\').getAttribute(\'innerText\');\n            }\n            console.log(nextTime);\n            coinmarketcap = await getBlanaceAndUpdate(page, coinmarketcap);\n        }\n    }\n    return coinmarketcap;\n}\n\n/**\n * 获取已领取的数量并更新时间\n * @param {Object} [coinmarketcap]\n * @param {import(\"playwright-core\").Page} page\n */\nasync function getBlanaceAndUpdate(page, coinmarketcap) {\n    const num = await page.textContent(\'.notranslate\');\n    console.log(\'已领取的砖石数量为：\' + num);\n    // @ts-ignore\n    coinmarketcap.sugar = parseInt(num);\n    coinmarketcap.lastsuc_date = dateFormat(new Date(), \'YYYY-MM-DD HH:mm:ss\');\n    coinmarketcap.update_time = dateFormat(new Date(), \'YYYY-MM-DD HH:mm:ss\');\n    return coinmarketcap;\n}\n\n/**\n * 登录\n * @param {import(\"playwright-core\").Page} page\n * @param {Object} [coinmarketcap]\n */\nasync function login(page, coinmarketcap, passowrd) {\n    await page.waitForTimeout(3000);\n    await page.locator(\'//button[@data-btnname=\"Log In\"]\').first().click();\n    await page.waitForTimeout(1000);\n    await page.locator(\"//input[@type=\'email\']\").first().fill(coinmarketcap.username);\n    await page.waitForTimeout(1000);\n    await page.locator(\"//input[@type=\'password\']\").first().fill(passowrd);\n    await page.waitForTimeout(1000);\n    let retryNum = 0;\n    while (retryNum < 10) {\n        retryNum++;\n        if (await page.locator(\'//div[text()=\"Your email and password does not match. Please try again.\"]\').isVisible()) {\n            const errorMsg = \'Your email and password does not match. Please try again.\';\n            console.error(\'登录失败：\' + errorMsg);\n            coinmarketcap.reg_status = 3;\n            coinmarketcap.last_error = errorMsg;\n            coinmarketcap.update_time = dateFormat(new Date(), \'YYYY-MM-DD HH:mm:ss\');\n            //todo 修改密码\n            return false;\n        }\n        if (await page.locator(\"//div[text()=\'or\']/preceding-sibling::button[text()=\'Log In\']\").isVisible()) {\n            await page.locator(\"//div[text()=\'or\']/preceding-sibling::button[text()=\'Log In\']\").click();\n            if (await downloadAndCheckImg(page)) {\n                await page.waitForTimeout(3000);\n                if (await page.isVisible(\'.notificationIcon\')) {\n                    console.log(\"登陆成功，继续操作\");\n                    return true;\n                }\n            }\n        }\n    }\n    return false;\n}\n\n/**\n * 登录\n * @param {import(\"playwright-core\").Page} page\n * @param {Object} [coinmarketcap]\n */\nasync function editPassword(page, coinmarketcap, passowrd) {\n    if (await page.locator(\'\"//span[text()=\"Forgot password?\"]\"\').isVisible()) {\n        await page.locator(\'//span[text()=\"Forgot password?\"]\').click();\n        await page.waitForTimeout(1000);\n        await page.getByPlaceholder(\'Enter your email address...\').last().fill(coinmarketcap.username);\n        await page.locator(\"//button[text()=\'Send Instructions\']\").click();\n        await page.waitForTimeout(3000);\n\n        let retryNum = 0;\n        let success = false;\n        while (retryNum < 10) {\n            retryNum++;\n            if (await page.locator(\"//button[text()=\'Send Instructions\']\").isVisible()) {\n                await page.locator(\"//button[text()=\'Send Instructions\']\").click();\n                if (await downloadAndCheckImg(page)) {\n                    await page.waitForTimeout(3000);\n                    if (await page.locator(\'//div[text()=\"Check your email\"]\').isVisible()) {\n                        console.log(\"发送验证码成功，等待\");\n                        success = true;\n                        break;\n                    }\n                }\n            }\n        }\n        if (success) {\n            let confirmUrl = await getMailConfirmUrl(coinmarketcap.username, \'coinmarketcap_reset_password\');\n            if (confirmUrl) {\n                await page.goto(confirmUrl, {waitUntil: \"domcontentloaded\"});\n                await page.waitForTimeout(2000);\n                if (await page.locator(\'//div[text()=\"Update your password\"]\').isVisible()) {\n                    await page.getByPlaceholder(\'Enter your new password...\').fill(passowrd);\n                    await page.getByPlaceholder(\'Repeat your new password...\').fill(passowrd);\n                    await page.locator(\'//button[text()=\"Update password\"]\').click();\n                    await page.waitForTimeout(3000);\n\n                    //再次出现滑块验证码\n                    retryNum = 0;\n                    while (retryNum < 10) {\n                        retryNum++;\n                        if (await page.locator(\"//button[text()=\'Send Instructions\']\").isVisible()) {\n                            await page.locator(\"//button[text()=\'Send Instructions\']\").click();\n                            if (await downloadAndCheckImg(page)) {\n                                await page.waitForTimeout(3000);\n                                //todo 判读是否修改成功\n                                return true;\n                            }\n                        }\n                    }\n                }\n            }\n        }\n    }\n    return false;\n}\n\n/**\n * 获取邮箱验证码或url\n * @param email\n * @param type\n * @returns {Promise<*>}\n */\nasync function getMailConfirmUrl(email, type) {\n    const response = await axios.post(scriptConfig.getDataByEmail, {\n        email: email,\n        type: type\n    }).catch(function (error) {\n        console.error(error.message)\n        return \"\";\n    }).finally(function () {\n    });\n    console.log(response.data);\n    let confirmUrl = response.data.data;\n    return confirmUrl.replace(\"&amp;\", \"&\");\n}\n\n/**\n * 下载验证码并验证\n * @param {import(\"playwright-core\").Page} page\n */\nasync function downloadAndCheckImg(page) {\n    console.log(\"等待验证码。。。\");\n    let checkSuccess = true;\n    try {\n        await page.waitForSelector(\"//div[text()=\'Security Verification\']\", {timeout: 10000});\n        console.log(\"出现了滑块验证\");\n        if (await page.locator(\'//button[text()=\"Collect Diamonds\"]\').isHidden()\n            && await page.locator(\'//button[text()=\"Log In to Collect\"]\').isHidden()) {\n            console.log(\"检查已经登录过了\");\n            console.log(\"今天已经领取过了\");\n            await page.waitForTimeout(3000);\n            let nextTime = await page.locator(\'//button[@data-btnname=\"Log In to Collect\"]\').textContent();\n            if (nextTime == \'Log In to Collect\') {\n                await page.waitForTimeout(2000);\n                nextTime = await page.locator(\'//button[@data-btnname=\"Log In to Collect\"]\').getAttribute(\'innerText\');\n            }\n            console.log(nextTime);\n            checkSuccess = true;\n        } else {\n            checkSuccess = await slider(page);\n        }\n\n    } catch (e) {\n        try {\n            console.log(\"没有出现滑块，判断是否出现了九宫格图片\");\n            await page.waitForSelector(\"//div[text()=\'Please select all images with\']\", {timeout: 1000});\n            checkSuccess = await jiugongge(page);\n        } catch (e1) {\n            console.log(\"没有出现九宫格验证\");\n        }\n    }\n    return checkSuccess;\n}\n\n/**\n * 滑块验证\n * @param {import(\"playwright-core\").Page} page\n */\nasync function slider(page) {\n    try {\n        while (true) {\n            if (await page.locator(\'//a[text()=\"Please try again\"]\').isVisible()) {\n                await page.locator(\'//a[text()=\"Please try again\"]\').click();\n                await page.waitForTimeout(3000);\n            }\n            let style = await page.locator(\'.bs-main-image\').getAttribute(\'style\');\n            // @ts-ignore\n            while (style.indexOf(\'none\') > -1) {\n                await page.waitForTimeout(1000);\n                if (await page.locator(\'//a[text()=\"Please try again\"]\').isVisible()) {\n                    await page.locator(\'//a[text()=\"Please try again\"]\').click();\n                    await page.waitForTimeout(3000);\n                }\n                style = await page.locator(\'.bs-main-image\').getAttribute(\'style\');\n            }\n            console.log(\"style:\" + style);\n            // @ts-ignore\n            const imageUrl = style.match(/\\\"(.*?)\\\"/g)[0].replace(\'\"\', \'\').replace(\'\"\', \'\');\n            console.log(\"imageUrl:\" + imageUrl);\n            //计算移动距离\n            let distance = await getSlidingDistance(imageUrl);\n            if (!distance) {\n                distance = 0;\n            }\n            console.log(\"移动距离：\" + distance);\n            //判断 当前系统缩放 \n            const zoom = await page.evaluate(\"window.devicePixelRatio || 1;\");\n            console.log(\"系统缩放：\" + zoom);\n            //\n            distance = distance * zoom;\n            console.log(\"实际应该滑动距离：\" + distance);\n\n            //获取拖动按钮位置并拖动\n            const arrow = await page.locator(\'.thumb-arrow\');\n            await page.waitForTimeout(1000);\n            const box = await arrow.boundingBox();\n            await page.waitForTimeout(1000);\n\n            //滑块处理\n            await page.locator(\'.thumb-arrow\').hover();\n            await page.waitForTimeout(500);\n            await page.mouse.down();\n            await page.waitForTimeout(500);\n            // @ts-ignore\n            let mov_x = Math.round(box[\'x\'] + box[\'width\'] / 2);\n            let start_x = mov_x;\n            // @ts-ignore\n            const mov_y = Math.round(box[\"y\"] + box[\"height\"] / 2);\n\n            const tracks = get_track2(distance);\n            console.log(tracks);\n            for (let i = 0; i < tracks.length; i++) {\n                // mov_x += Math.round(tracks[i]);\n                // //@ts-ignore\n                // await page.mouse.move(mov_x, mov_y + randomNum(-2, 2), { steps: 2 });\n                await page.mouse.move(mov_x, mov_y + randomNum(-2, 2), {steps: 2});\n                mov_x += Math.round(tracks[i]);\n                if (i < 0.8 * tracks.length) {\n                    await page.waitForTimeout(randomNum(50, 80));\n                } else {\n                    await page.waitForTimeout(randomNum(150, 200));\n                }\n            }\n            console.log(\'应该滑动距离：\' + (distance));\n            console.log(\'实际滑动距离：\' + (mov_x - start_x));\n            //防止有误差\n            await page.mouse.move(Math.round(start_x + distance), mov_y + randomNum(-2, 2), {steps: 2});\n\n            await page.waitForTimeout(500);\n            await page.mouse.up();\n\n            await page.waitForTimeout(5000);\n            console.log(\"判断滑块是否消失\");\n            if (await page.locator(\"//div[text()=\'Security Verification\']\").isHidden()) {\n                console.log(\"滑块消失,判断是否验证成功\");\n                return true;\n            } else {\n                console.log(\"滑块未消失,重新验证\");\n                await page.locator(\'.bs-refresh-icon\').click();\n                await page.waitForTimeout(3000);\n            }\n        }\n\n    } catch (e) {\n        console.error(e);\n    }\n    return false;\n}\n\n/**\n * 请求计算滑块距离\n * @param {string} imageUrl\n */\nasync function getSlidingDistance(imageUrl) {\n    try {\n        console.log(scriptConfig.checkSliderUrl);\n        const response = await axios({\n            method: \'post\',\n            url: scriptConfig.checkSliderUrl,\n            data: {\n                url: imageUrl\n                // url: await getImgBase64ByUrl(imageUrl)\n            }\n        });\n        console.log(response.data);\n        return await response.data;\n    } catch (error) {\n        console.error(error);\n    }\n}\n\n/**\n * 九宫格图片验证\n * @param {import(\"playwright-core\").Page} page\n */\nasync function jiugongge(page) {\n    try {\n        while (true) {\n            //可能网络问题出不了图片，可能需要再次点击\n            try {\n                await page.waitForSelector(\"//div[text()=\'Please select all images with\']\", {timeout: 10000});\n            } catch (e) {\n                let agin = 0;\n                while (agin < 10 && await page.locator(\"//button[text()=\'Create an account\']\").last().isVisible()) {\n                    await page.locator(\"//button[text()=\'Create an account\']\").last().click();\n                    await page.waitForTimeout(5000);\n                    agin++;\n                }\n                agin = 0;\n                while (agin < 10 && await page.locator(\"//div[text()=\'or\']/preceding-sibling::button[text()=\'Log In\']\").first().isVisible()) {\n                    await page.locator(\"//button[text()=\'Create an account\']\").first().click();\n                    await page.waitForTimeout(5000);\n                    agin++;\n                }\n                if (await page.isHidden(\"//div[text()=\'Please select all images with\']\")) {\n                    console.error(\"再次尝试后没有出现验证码\");\n                    return false;\n                }\n            }\n\n            if (await page.locator(\"//a[text()=\'Please try again\']\").isVisible()) {\n                console.info(\"加载图片失败，点击Please try again重新获取\");\n                await page.locator(\"//a[text()=\'Please try again\']\").first().click();\n                await page.waitForTimeout(3000);\n            }\n\n\n            if (await page.isVisible(\'.bcap-image-cell-image\')) {\n                await page.waitForTimeout(3000);\n                const style1 = await page.locator(\'.bcap-image-cell-image\').first().getAttribute(\'style\');\n                console.log(\'style1:\' + style1);\n                // @ts-ignore\n                const imgurl1 = style1.match(/\\\"(.*?)\\\"/g)[0].replace(\'\"\', \'\').replace(\'\"\', \'\');\n                console.info(\"imgurl1:\", imgurl1);\n\n                let imgurl2 = \"\";\n                const style2 = await page.locator(\'.bcap-image-cell-image\').last().getAttribute(\'style\');\n                if (style2) {\n                    console.log(\'style2:\' + style2);\n                    // @ts-ignore\n                    let imgurl2 = style2.match(/\\\"(.*?)\\\"/g)[0].replace(\'\"\', \'\').replace(\'\"\', \'\');\n                    console.info(\"imgurl2:\", imgurl2);\n                    if (imgurl1 == imgurl2) {\n                        imgurl2 = \"\";\n                    }\n                }\n\n                const title2 = await page.locator(\'#tagLabel\').textContent();\n                console.info(\"title:\", title2);\n                // @ts-ignore\n                let checkData = await checkImage(page, imgurl1, imgurl2, title2);\n\n                if (await validationImg(page, checkData)) {\n                    return true;\n                }\n                await page.waitForTimeout(2000);\n            }\n        }\n\n    } catch (e) {\n        console.error(e);\n        return false;\n    }\n}\n\n/**\n * 九宫格图片验证\n * @param {import(\"playwright-core\").Page} page\n * @param {string} imgurl1\n * @param {string} imgurl2\n * @param {string} title2\n */\nasync function checkImage(page, imgurl1, imgurl2, title2) {\n    try {\n        const response = await axios.post(scriptConfig.remoteImgCheckUrl, {\n            title: title2,\n            img1: imgurl1,\n            img2: imgurl2,\n        }).catch(function (error) {\n            console.error(error.message)\n        }).finally(function () {\n        });\n        console.log(response.data);\n        console.log(response.data.data);\n        return await response.data.data || \'\';\n    } catch (error) {\n        console.error(error);\n    }\n}\n\n/**\n * 下载网络图片并转换为base64\n * @param {string} imgurl1\n */\nasync function getImgBase64ByUrl(imgurl1) {\n    if (!imgurl1 || imgurl1 == \"none\") {\n        return \"\";\n    }\n    const file = path.resolve(__dirname, \'/temp/\' + imgurl1.substring(imgurl1.lastIndexOf(\"/\") + 1));\n    await axios({\n        method: \'get\',\n        url: imgurl1,\n        responseType: \'stream\'\n    }).then(function (response) {\n        response.data.pipe(fs.createWriteStream(file));\n    });\n    await sleep(3000);\n    const base64 = imgFileToBase64(file);\n    //转换完成后删除图片\n    fs.unlinkSync(file);\n    return base64;\n}\n\n/**\n * 点击九宫格图片\n * @param {import(\"playwright-core\").Page} page\n * @param {string} checkData\n */\nasync function validationImg(page, checkData) {\n    console.info(\"验证结果：\" + checkData);\n    const s1 = checkData.split(\"\\\\|\");\n    if (s1.length == 0) {\n        console.info(\"图片验证无结果，刷新重新验证！\");\n        await page.locator(\'.bcap-icon-refresh\').click();\n        await page.waitForTimeout(5000);\n        return false;\n    }\n    const ss0 = s1[0].split(\',\');\n    for (let i = 0; i < ss0.length; i++) {\n        const index = ss0[i] ? parseInt(ss0[i]) : randomNum(1, 9);\n        console.info(\"点击第\" + index + \"个图片\");\n        await page.locator(\'.bcap-image-cell-image\').nth(index - 1).click();\n        await page.waitForTimeout(randomNum(500, 1000));\n    }\n\n    if (await page.locator(\"//div[text()=\'Next\']\").isVisible()) {\n        await page.waitForTimeout(1000);\n        await page.locator(\"//div[text()=\'Next\']\").click();\n        await page.waitForTimeout(2000);\n        if (s1.length > 1 && s1[1]) {\n            const ss1 = s1[1].split(\',\');\n            for (let i = 0; i < ss1.length; i++) {\n                let index = parseInt(ss1[i]);\n                if (index < 10) {\n                    index = index + 9;\n                }\n                console.info(\"点击第2张的第\" + (index - 9) + \"个图片\");\n                await page.locator(\'.bcap-image-cell-image\').nth(index - 1).click();\n                await page.waitForTimeout(randomNum(500, 1000));\n            }\n        }\n    }\n\n    if (await page.locator(\"//div[text()=\'Verify\']\").isVisible()) {\n        console.info(\"点击Verify\");\n        await page.waitForTimeout(500);\n        await page.locator(\"//div[text()=\'Verify\']\").click()\n        const message = await getMessage(page);\n        // @ts-ignore\n        if (message.indexOf(\"Account existed! Please log in or try another email address.\") > -1) {\n            throw \"账户已经注册，无需再次注册，请直接登录\";\n        }\n        await page.waitForTimeout(5000);\n        //判断验证结果，如果继续验证就循环验证否则取消\n        if (await page.isHidden(\"//div[text()=\'Please select all images with\']\")) {\n            return true;\n        }\n    }\n    return false;\n}\n\n/**\n * 点击九宫格图片\n * @param {import(\"playwright-core\").Page} page\n */\nasync function getMessage(page) {\n    try {\n        await page.waitForSelector(\"//div[@isolate_identify=\'Message\']\", {timeout: 3000});\n    } catch (e) {\n        return \"\";\n    }\n    const text = await page.locator(\"//div[@isolate_identify=\'Message\']\").textContent();\n    const fill = await page.locator(\"//div[@isolate_identify=\'Message\']\").locator(\'svg\').first().getAttribute(\"fill\");\n    if (\"red\" == fill) {\n        console.error(\"错误提信息：\", text);\n    } else {\n        console.info(\"提示信息：\", text);\n    }\n    return text;\n}\n\n/**\n * 图片转base64\n * @param {string} file\n * @returns\n */\nfunction imgFileToBase64(file) {\n    let filePath = path.resolve(file); // 原始文件地址\n    // 读取文件数据\n    let data = fs.readFileSync(filePath);\n    return Buffer.from(data).toString(\'base64\');\n}\n\n/**\n * 随机数字\n * @param {number} min\n * @param {number} max\n * @returns\n */\nfunction randomNum(min, max) {\n    return Math.floor(Math.random() * (max - min + 1) + min);\n}\n\nconst dateFormat = function (date, format) {\n    var Y = date.getFullYear()\n    var M = date.getMonth() + 1\n    var D = date.getDate()\n    var hour = date.getHours()\n    var min = date.getMinutes()\n    var sec = date.getSeconds()\n    if (format === \'YYYY\') {\n        return Y\n    } else if (format === \'YYYY-MM\') {\n        return Y + \'-\' + (M < 10 ? \'0\' + M : M)\n    } else if (format === \'YYYY-MM-DD\') {\n        return Y + \'-\' + (M < 10 ? \'0\' + M : M) + \'-\' + (D < 10 ? \'0\' + D : D)\n    } else if (format === \'HH:mm:ss\') {\n        return (hour < 10 ? \'0\' + hour : hour) + \':\' + (min < 10 ? \'0\' + min : min) + \':\' + (sec < 10 ? \'0\' + sec : sec)\n    } else if (format === \'YYYY-MM-DD HH:mm\') {\n        return Y + \'-\' + (M < 10 ? \'0\' + M : M) + \'-\' + (D < 10 ? \'0\' + D : D) + \' \' + (hour < 10 ? \'0\' + hour : hour) + \':\' + (min < 10 ? \'0\' + min : min)\n    } else if (format === \'YYYY-MM-DD HH:mm:ss\') {\n        return Y + \'-\' + (M < 10 ? \'0\' + M : M) + \'-\' + (D < 10 ? \'0\' + D : D) + \' \' + (hour < 10 ? \'0\' + hour : hour) + \':\' + (min < 10 ? \'0\' + min : min) + \':\' + (sec < 10 ? \'0\' + sec : sec)\n    } else {\n        return \'--\'\n    }\n}\n\n/**\n * 获取移动轨迹\n * @param {number} distance\n * @returns\n */\nfunction get_track(distance) {\n    const track = [];// 移动轨迹\n    let current = 0;// 已经移动的距离\n    let mid = Math.round(distance * 4 / 5);// 减速阈值\n    let a = 0;\n    let move = 0;// 每次循环移动的距离\n    let min = 1, max = 9;\n    if (distance < 120) {\n        max = 5;\n    }\n    if (distance < 170) {\n        max = 7;\n    }\n    while (true) {\n        a = randomNum(min, max);\n        if (current <= mid) {\n            move += a;// 不断加速\n        } else {\n            move -= a;\n        }\n        if ((current + move) < distance) {\n            track.push(move);\n        } else {\n            track.push(distance - current);\n            break;\n        }\n        current += move;\n    }\n    return track;\n}\n\n/**\n * 获取移动轨迹\n * @param {number} distance\n * @returns\n */\nfunction get_track2(distance) {\n    let track = []\n    let current = 0\n    let mid = distance * 4 / 5\n    let t = 0.2\n    let v = 1\n    while (current < distance) {\n        let a\n        if (current < mid) {\n            a = 4\n        } else {\n            a = -2\n        }\n        let v0 = v\n        v = v0 + a * t\n        let move = v0 * t + 1 / 2 * a * t * t\n        current += move\n        track.push(Math.round(move))\n    }\n    return track\n}\n\n/**\n * @param {number | undefined} ms\n */\nfunction sleep(ms) {\n    return new Promise(resolve => setTimeout(resolve, ms))\n}', '', 'damos', '2022-12-02', 'damos', '2022-12-14', 'A03', '0');
